import React, { Component } from 'react'
import villiansData from '../src/data/planets.js'

const rotation_period = villiansData.planets[0].rotation_period



class Villians extends Component {
    render() {
        return (
            <div>
                <h1>Villians</h1>
                <h1>{rotation_period.length}Planets</h1>
            </div>

        )

    }



}

export default Villians
